import React from 'react'

export default function NameWindow(props) {


  return (
    <div className='window'>
      <div className='wName'>
        {props.emergency.number} <br />
        {props.user.fName}
      </div>
      <button onClick={()=> props.changePage("cancel")}>Cancel</button>
    </div>
  )
}
